import React, {lazy, Suspense} from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
// import Home from "./pages/Home"
// import Contact from "./pages/Contact"
// import Portfolio from './pages/Portfolio';
// import MyNavbar from './components/Layout/MyNavbar'
// import Footer from './components/Layout/Footer';

import { library } from '@fortawesome/fontawesome-svg-core'
import { fab } from '@fortawesome/free-brands-svg-icons'
import { faCheckSquare, faCoffee, faFileAlt, faEnvelope } from '@fortawesome/free-solid-svg-icons'

library.add(fab, faCheckSquare, faCoffee, faFileAlt, faEnvelope)


const Home = lazy(() => import('./pages/Home'));
const Contact = lazy(() => import('./pages/Contact'));
const Portfolio = lazy(() => import('./pages/Portfolio'));
const MyNavbar = lazy(() => import('./components/Layout/MyNavbar'));
const footer = lazy(()=> import('./components/Layout/Footer'))



const App = () => {
  return (
    <Router>
    <Suspense fallback={<div>Loading</div>}>
      <MyNavbar />
        <Switch>
          <Route exact path="/" component={Home} />
            <Route exact path="/contact" component={Contact} />
            <Route exact path="/portfolio" component={Portfolio} />
        </Switch>
        <Footer />
      </Suspense>
    </Router>
  );
}

export default App;
